     &     ZNeu(Neu3,1) + CW*Mf(2,gno1)*UASf(All3,gno1,2)*
     &     ZNeu(Neu3,3)

        dup23 = 2*CB*MW*SW*UASfC(All3,3 + gno1,2)*
     &     ZNeuC(Neu3,1) + 
     &    CW*Mf(2,gno1)*UASfC(All3,gno1,2)*ZNeuC(Neu3,3)

        dZfR1(2,gno1,gno2) = 
     &   dZfR1(2,gno1,gno2) + 
     &    1/(8.D0*Pi)*(AlfaMZ*
     &        (dup22*dup23*
     &           Re(B1(Mf2(2,gno1),MNeu2(Neu3),MASf2(All3,2))) + 
     &          CB*MW*Mf(2,gno1)*
     &           (MNeu(Neu3)*
     &              Re(DB0(Mf2(2,gno1),MASf2(All3,2),MNeu2(Neu3)))*
     &              (dup22*UASfC(All3,gno1,2)*
     &                 (SW*ZNeu(Neu3,1) + CW*ZNeu(Neu3,2)) + 
     &                dup23*UASf(All3,gno1,2)*
     &                 (SW*ZNeuC(Neu3,1) + CW*ZNeuC(Neu3,2))) + 
     &             Mf2(2,gno1)*
     &              Re(DB1(Mf2(2,gno1),MNeu2(Neu3),MASf2(All3,2)))*
     &              (UASf(All3,gno1,2)*UASfC(All3,3 + gno1,2)*
     &                 ZNeu(Neu3,3)*
     &                 (CW*SW*ZNeuC(Neu3,1) - CW2*ZNeuC(Neu3,2)) + 
     &                UASf(All3,3 + gno1,2)*UASfC(All3,gno1,2)*
     &                 (CW*SW*ZNeu(Neu3,1) - CW2*ZNeu(Neu3,2))*
     &                 ZNeuC(Neu3,3))) - 
     &          Mf2(2,gno1)*
     &           (CW*MNeu(Neu3)*
     &              Re(DB0(Mf2(2,gno1),MASf2(All3,2),MNeu2(Neu3)))*
     &              (dup22*UASfC(All3,3 + gno1,2)*ZNeu(Neu3,3) + 
     &                dup23*UASf(All3,3 + gno1,2)*ZNeuC(Neu3,3)) - 
     &             Re(DB1(Mf2(2,gno1),MNeu2(Neu3),MASf2(All3,2)))*
     &              (UASf(All3,3 + gno1,2)*UASfC(All3,3 + gno1,2)*
     &                 (4*CB2*MW2*SW2*ZNeu(Neu3,1)*ZNeuC(Neu3,1) + 
     &                   CW2*Mf2(2,gno1)*ZNeu(Neu3,3)*ZNeuC(Neu3,3)
     &                   ) + 
     &                UASf(All3,gno1,2)*UASfC(All3,gno1,2)*
     &                 (CB2*MW2*
     &                    (ZNeu(Neu3,2)*
     &                       (CW*SW*ZNeuC(Neu3,1) + 
     &                       CW2*ZNeuC(Neu3,2)) + 
     &                      ZNeu(Neu3,1)*
     &                       (SW2*ZNeuC(Neu3,1) + 
     &                       CW*SW*ZNeuC(Neu3,2))) + 
     &                   CW2*Mf2(2,gno1)*ZNeu(Neu3,3)*ZNeuC(Neu3,3)
     &                   )))))/(CB2*CW2*MW2*SW2)

	ENDLOOP(All3)
	ENDLOOP(Neu3)

	LOOP(Gen3, 1,3,1)
	LOOP(Cha3, 1,2,1)

        dZfR1(2,gno1,gno2) = 
     &   dZfR1(2,gno1,gno2) + 
     &    1/(8.D0*Pi)*(AlfaMZ*Mf2(2,gno1)*UASf(Gen3,gno1,1)*
     &        UASfC(Gen3,gno1,1)*
     &        (CB*MW*(Re(B1(Mf2(2,gno1),MCha2(Cha3),
     &               MASf2(Gen3,1))) + 
     &             Mf2(2,gno1)*
     &              Re(DB1(Mf2(2,gno1),MCha2(Cha3),MASf2(Gen3,1))))
     &            *UCha(Cha3,2)*UChaC(Cha3,2) + 
     &          CB2*MW2*(sqrt2*
     &              (MCha(Cha3)*
     &                Re(DB0(Mf2(2,gno1),MASf2(Gen3,1),
     &                  MCha2(Cha3)))*
     &                (UCha(Cha3,2)*VCha(Cha3,1) + 
     &                  UChaC(Cha3,2)*VChaC(Cha3,1))) + 
     &             2*CB*MW*
     &              Re(DB1(Mf2(2,gno1),MCha2(Cha3),MASf2(Gen3,1)))*
     &              VCha(Cha3,1)*VChaC(Cha3,1))))/
     &      (CB*CB2*MW*MW2*SW2)

	ENDLOOP(Cha3)
	ENDLOOP(Gen3)

	else

	dZfR1(2,gno1,gno2) = 0

	LOOP(Neu3, 1,4,1)
	LOOP(All3, 1,6,1)

	dup24 = SW*ZNeu(Neu3,1) + CW*ZNeu(Neu3,2)

	dup25 = SW*ZNeuC(Neu3,1) + CW*ZNeuC(Neu3,2)

        dup26 = 2*CB*MW*SW*UASf(All3,3 + gno2,2)*
     &     ZNeu(Neu3,1) + CW*Mf(2,gno2)*UASf(All3,gno2,2)*
     &     ZNeu(Neu3,3)

        dup27 = CB*dup24*MW*UASfC(All3,gno1,2) - 
     &    CW*Mf(2,gno1)*UASfC(All3,3 + gno1,2)*ZNeu(Neu3,3)

        dup28 = CB*dup25*MW*UASf(All3,gno2,2) - 
     &    CW*Mf(2,gno2)*UASf(All3,3 + gno2,2)*ZNeuC(Neu3,3)

        dup29 = 2*CB*MW*SW*UASfC(All3,3 + gno1,2)*
     &     ZNeuC(Neu3,1) + 
     &    CW*Mf(2,gno1)*UASfC(All3,gno1,2)*ZNeuC(Neu3,3)

        dZfR1(2,gno1,gno2) = 
     &   dZfR1(2,gno1,gno2) - 
     &    1/(4.D0*Pi)*(AlfaMZ*
     &        ((dup26*dup27*Mf(2,gno1) + dup28*dup29*Mf(2,gno2))*
     &           MNeu(Neu3)*
     &           Re(B0(Mf2(2,gno2),MASf2(All3,2),MNeu2(Neu3))) + 
     &          (dup27*dup28*Mf(2,gno1)*Mf(2,gno2) + 
     &             dup26*dup29*Mf2(2,gno2))*
     &           Re(B1(Mf2(2,gno2),MNeu2(Neu3),MASf2(All3,2)))))/
     &      (CB2*CW2*MW2*SW2*(Mf2(2,gno1) - Mf2(2,gno2)))

	ENDLOOP(All3)
	ENDLOOP(Neu3)

	LOOP(Gen3, 1,3,1)
	LOOP(Cha3, 1,2,1)

        dZfR1(2,gno1,gno2) = 
     &   dZfR1(2,gno1,gno2) - 
     &    1/(4.D0*Pi)*(AlfaMZ*Mf(2,gno1)*Mf(2,gno2)*
     &        UASf(Gen3,gno2,1)*UASfC(Gen3,gno1,1)*
     &        (CB*MW*Mf2(2,gno2)*
     &           Re(B1(Mf2(2,gno2),MCha2(Cha3),MASf2(Gen3,1)))*
     &           UCha(Cha3,2)*UChaC(Cha3,2) + 
     &          CB2*MW2*(sqrt2*
     &              (MCha(Cha3)*
     &                Re(B0(Mf2(2,gno2),MASf2(Gen3,1),
     &                  MCha2(Cha3)))*
     &                (UCha(Cha3,2)*VCha(Cha3,1) + 
     &                  UChaC(Cha3,2)*VChaC(Cha3,1))) + 
     &             2*CB*MW*
     &              Re(B1(Mf2(2,gno2),MCha2(Cha3),MASf2(Gen3,1)))*
     &              VCha(Cha3,1)*VChaC(Cha3,1))))/
     &      (CB*CB2*MW*MW2*SW2*(Mf2(2,gno1) - Mf2(2,gno2)))

	ENDLOOP(Cha3)
	ENDLOOP(Gen3)

	endif

#ifdef DETAILED_DEBUG
	DCOUP "dZfR1(2,gno1,gno2) =", dZfR1(2,gno1,gno2) ENDL
#endif

	ENDLOOP(gno2)

	ENDLOOP(gno1)

	end
